import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';

const SocialBox = (props)=> {

    return(
        <div style={{background : props.social.toLowerCase() ===
            'facebook' ? '#4267b2' : 
            'twitter'  ? '#1DA1F2' :
            'linkedin' ? '#2867b2' : 
            '#2867b2'

            }} className="box">
            <div className="socialIconContainer">
                <FontAwesomeIcon
                    className='icon'
                    icon={props.icon}
                />
            </div>
            <div className="moreContent">
                <h3>CHECK ME ON</h3>
                <p>{props.social}</p>
            </div>
        </div>
    )

}


export default SocialBox;
